        <div className="loginPage">
        <div className="round"></div>
        <img src=""></img> 
        <h1 className="loginH1">Login</h1>
        <p>Welcome Back!</p>

        <form>

            <input 
            type="email" 
            id="email" 
            className="email" 
            name="email"
            aria-label="Email" placeholder="Email" 
            required 
            value={email}
            onChange={(e)=> setEmail(e.target.value)}
            />

