            type="text" 
            id="password" 
            className="password" 
            name="password"
            aria-label="Password" placeholder="Password" 
            required 
            value={password}
            onChange={(e)=> setPassword(e.target.value)}
            />

            <input type="submit" value="Login"
            onClick={this.onClickSubmit}/>
